     * @dev Returns the remainder of dividing two unsigned integers. (unsigned integer modulo),
     * Reverts with custom message when dividing by zero.
     *
     * Counterpart to Solidity's `%` operator. This function uses a `revert`
     * opcode (which leaves remaining gas untouched) while Solidity uses an
     * invalid opcode to revert (consuming all remaining gas).
     *
     * Requirements:
     * - The divisor cannot be zero.
     */
    function mod(
        uint256 a,
        uint256 b,
        string memory errorMessage
    ) internal pure returns (uint256) {
        require(b != 0, errorMessage);
        return a % b;
    }
}

contract power is ERC20, Ownable {

    using SafeMath for uint256;
    bool private swapping;
    IUniswapV2Router02 public uniswapV2Router;
    address public uniswapV2Pair;
    address public usdtAddr;
    uint256 public constant MAX_SUPPLY = 638750 * 10**6;
    address public feeAcceptWallet;
    uint256 public buyFee = 5;
    uint256 public sellFee = 5;
    // fee write list
    mapping(address => bool) public _isExcludedFromFees;
    // pairs list
    mapping(address => bool) public automatedMarketMakerPairs;

    event ExcludeFromFees(address indexed account, bool isExcluded);
    event ExcludeMultipleAccountsFromFees(address[] accounts, bool isExcluded);
    event SetAutomatedMarketMakerPair(address indexed pair, bool indexed value);

    constructor(
        string memory name_,
        string memory symbol_,
        address router_,
        address usdtAddr_,
        address feeAcceptWallet_
    ) payable ERC20(name_, symbol_) {
        usdtAddr = usdtAddr_;
        feeAcceptWallet = feeAcceptWallet_;
        IUniswapV2Router02 _uniswapV2Router = IUniswapV2Router02(router_);

        address _uniswapV2Pair = IUniswapV2Factory(_uniswapV2Router.factory())
            .createPair(address(this), usdtAddr);
        uniswapV2Router = _uniswapV2Router;
        uniswapV2Pair = _uniswapV2Pair;
        _setAutomatedMarketMakerPair(_uniswapV2Pair, true);

        excludeFromFees(owner(), true);
        excludeFromFees(address(this), true);

        _mint(msg.sender, MAX_SUPPLY);
    }

    receive() external payable {}

    //======set========
    // set fee write list
    function excludeFromFees(address account, bool excluded)
        public
        onlyOwner
        returns (bool)
    {
        require(
            _isExcludedFromFees[account] != excluded,
            "power:Account is already the value of 'excluded'"
        );
        _isExcludedFromFees[account] = excluded;

        emit ExcludeFromFees(account, excluded);
        return true;
    }

    //batch set fee write list
    function excludeMultipleAccountsFromFees(
        address[] calldata accounts,
        bool excluded
    ) public onlyOwner returns (bool) {
        for (uint256 i = 0; i < accounts.length; i++) {
            _isExcludedFromFees[accounts[i]] = excluded;
        }

        emit ExcludeMultipleAccountsFromFees(accounts, excluded);
        return true;
    }

    //set automated marketMaker Pair
    function setAutomatedMarketMakerPair(address pair, bool value)
        public
        onlyOwner
    {
        require(
            pair != uniswapV2Pair,
            "power:The PancakeSwap pair cannot be removed from automatedMarketMakerPairs"
        );

        _setAutomatedMarketMakerPair(pair, value);
    }

    function _setAutomatedMarketMakerPair(address pair, bool value) private {
        require(
            automatedMarketMakerPairs[pair] != value,
            "power:Automated market maker pair is already set to that value"
        );
        automatedMarketMakerPairs[pair] = value;

        emit SetAutomatedMarketMakerPair(pair, value);
    }



    function setFeeAcceptWallet(address _feeAcceptWallet)
        public
        onlyOwner
        returns (bool)
    {
        feeAcceptWallet = _feeAcceptWallet;
        return true;
    }

    function setBuyFee(uint256 _buyFee) public onlyOwner returns (bool) {
        require(_buyFee <= 100, "power:The commission percentage cannot exceed 100%");
        buyFee = _buyFee;
        return true;
    }

    function setSellFee(uint256 _sellFee) public onlyOwner returns (bool) {
        require(
            _sellFee <= 100,
            "power:The commission percentage cannot exceed 100%"
        );
        sellFee = _sellFee;
        return true;
    }

    //=====get======
    function getSellFee() public view returns (uint256) {
        return sellFee;
    }

    function getBuyFee() public view returns (uint256) {
        return buyFee;
    }

    function getFeeAcceptWallet() public view returns (address) {
        return feeAcceptWallet;
    }



    //select account is fee write
    function getExcludedFromFees(address account) public view returns (bool) {
        return _isExcludedFromFees[account];
    }

    function getAutomatedMarketMakerPair(address _pair)
        public
        view
        returns (bool)
    {
        return automatedMarketMakerPairs[_pair];
    }


    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        require(from != address(0), "power: transfer from the zero address");
        require(to != address(0), "power: transfer to the zero address");

        if (amount == 0) {
            super._transfer(from, to, 0);
            return;
        }

        bool takeFee = !swapping;
        if (_isExcludedFromFees[from] || _isExcludedFromFees[to]) {
            takeFee = false;
        }

        if (takeFee) {
            if (
                automatedMarketMakerPairs[from] || automatedMarketMakerPairs[to]
            ) {
                _swapTokenAndFees(from, to, amount);
            } else {
                super._transfer(from, to, amount);
            }
        } else {
            super._transfer(from, to, amount);
        }
    
    }

    function _swapTokenAndFees(
        address from,
        address to,
        uint256 amount
    ) internal {
        uint256 feeAmount = 0;
        //buy and remove liquidity
        if (automatedMarketMakerPairs[from]) {
            if(!_fromIsLiquidity()){
                 feeAmount = amount.mul(buyFee).div(100);
                 amount = amount.sub(feeAmount);
            }
           

            //sell and add liquidity
        } else if (automatedMarketMakerPairs[to]) {
            if(!_toIsLiquidity()){
                feeAmount = amount.mul(sellFee).div(100);
                 amount = amount.sub(feeAmount);
            }
           
        }
      
        if(feeAmount > 0){
            super._transfer(from, feeAcceptWallet, feeAmount);
        }
        super._transfer(from, to, amount);
    }

    function _toIsLiquidity()internal view returns(bool){   
        // sell usdt - power +   add usdt +  power +  
        address token0 = IUniswapV2Pair(address(uniswapV2Pair)).token0();
        address token1 = IUniswapV2Pair(address(uniswapV2Pair)).token1();
        (uint r0,uint r1,) = IUniswapV2Pair(address(uniswapV2Pair)).getReserves();
        uint bal0 = IERC20(token0).balanceOf(address(uniswapV2Pair));
        uint bal1 = IERC20(token1).balanceOf(address(uniswapV2Pair));
          if(token0 == address(usdtAddr)){
            if(  bal0 > r0 ){
                return true;
        }
        }
        if(token1 == address(usdtAddr)){
            if(  bal1 >  r1 ){    
                return true;
            }
        }
        return false;
    }

     function _fromIsLiquidity()internal view returns(bool){  
         // buy usdt + power-   remove usdt- power-   
        address token0 = IUniswapV2Pair(address(uniswapV2Pair)).token0();
        address token1 = IUniswapV2Pair(address(uniswapV2Pair)).token1();
        (uint r0,uint r1,) = IUniswapV2Pair(address(uniswapV2Pair)).getReserves();
        uint bal0 = IERC20(token0).balanceOf(address(uniswapV2Pair));
        uint bal1 = IERC20(token1).balanceOf(address(uniswapV2Pair));
          if(token0 == address(usdtAddr)){
            if(  bal0 <= r0 ){
                return true;
            }
        }
        if(token1 == address(usdtAddr)){
            if(  bal1 <= r1 ){
                
                return true;
            }
        }
        return false;
    }

}
